DROP TABLE IF EXISTS process_usage;
DROP TABLE IF EXISTS process;

CREATE TABLE process(
    id INTEGER PRIMARY KEY,
    name TEXT
);

CREATE TABLE process_usage(
    process_id INTEGER REFERENCES process(id),
    usage INTEGER,
    time TIMESTAMP
);
CREATE INDEX idx_process_usage ON process_usage (process_id, usage);

